import { useState } from "react";

function App() {
  const [n, setN] = useState(1);

  let fn = () => {
    setN(current => current + 1)
  }

  return (
    <>
      <h3>1씩증가</h3>
      <p><button onClick={fn}>버튼</button></p>
      <p>현재값 : {n}</p>
    </>
  );
}

export default App;
